import React, { useEffect, useState } from "react";
import Table from 'react-bootstrap/Table';


const Apicall = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
   getList();
  }, []);
  console.warn(data);
  function getList(){
    fetch("http://localhost:8080/Usera").then((result) => {
      result.json().then((resp) => {
        // console.warn("result",resp)
        setData(resp);
      });
    });
  }

  const deleteUser=(id)=> {
  fetch(`http://localhost:8080/Usera/${id}`,{
    method: 'DELETE'
  }).then((result)=>{
    result.json().then((resp)=>{
      console.warn(resp);
      getList();
    })
  })


  }


  return (
    <div className="App">
      <h1>Get call Api</h1>
      <Table>
        <tr>
          <td>Id</td>
          <td>Name</td>
          <td>Email</td>
          <td>Address</td>
          <td>Actions</td>
        </tr>
        {data.map((item) => (
          <tr>
            <td>{item.id}</td>
            <td>{item.name}</td>
            <td>{item.email}</td>
            <td>{item.address}</td>
          <td><button onClick={()=>deleteUser(item.id)}>Delete</button>   

          <button>Update</button></td>
          </tr>
        ))}
      </Table>
    </div>
  );
};

export default Apicall;
